        <script type="text/javascript">

              // initialize global variables.
              var edges;
              var nodes;
              var allNodes;
              var allEdges;
              var nodeColors;
              var originalNodes;
              var network;
              var container;
              var options, data;
              var filter = {
                  item : '',
                  property : '',
                  value : []
              };

              

              

              // This method is responsible for drawing the graph, returns the drawn network
              function drawGraph() {
                  var container = document.getElementById('mynetwork');

                  

                  // parsing and collecting nodes and edges from the python
                  nodes = new vis.DataSet([{"color": "#48D1CC", "font_size": 40, "id": "received", "label": "received", "shape": "dot"}, {"color": "#48D1CC", "font_size": 40, "id": "Rachel", "label": "Rachel", "shape": "dot"}, {"color": "#48D1CC", "font_size": 40, "id": "flowers", "label": "flowers", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "325", "label": "325", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "300", "label": "300", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "20", "label": "20", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "5", "label": "5", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "18", "label": "18", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "10", "label": "10", "shape": "dot"}, {"color": "#FFCC99", "font_size": 40, "id": "8", "label": "8", "shape": "dot"}, {"color": "#48D1CC", "font_size": 40, "id": "chocolates", "label": "chocolates", "shape": "dot"}]);
                  edges = new vis.DataSet([{"color": "#ADD8E6", "font_size": 50, "from": "received", "to": "Rachel"}, {"color": "#ADD8E6", "font_size": 50, "from": "received", "to": "flowers"}, {"color": "#ADD8E6", "font_size": 50, "from": "325", "to": "300"}, {"color": "#ADD8E6", "font_size": 50, "from": "325", "to": "20"}, {"color": "#ADD8E6", "font_size": 50, "from": "325", "to": "5"}, {"color": "#ADD8E6", "font_size": 50, "from": "flowers", "to": "325"}, {"color": "#ADD8E6", "font_size": 50, "from": "18", "to": "10"}, {"color": "#ADD8E6", "font_size": 50, "from": "18", "to": "8"}, {"color": "#ADD8E6", "font_size": 50, "from": "chocolates", "to": "18"}, {"color": "#ADD8E6", "font_size": 50, "from": "received", "to": "chocolates"}]);

                  nodeColors = {};
                  allNodes = nodes.get({ returnType: "Object" });
                  for (nodeId in allNodes) {
                    nodeColors[nodeId] = allNodes[nodeId].color;
                  }
                  allEdges = edges.get({ returnType: "Object" });
                  // adding nodes and edges to the graph
                  data = {nodes: nodes, edges: edges};

                  var options = {
    "configure": {
        "enabled": false
    },
    "edges": {
        "color": {
            "inherit": true
        },
        "smooth": {
            "enabled": true,
            "type": "dynamic"
        }
    },
    "interaction": {
        "dragNodes": true,
        "hideEdgesOnDrag": false,
        "hideNodesOnDrag": false
    },
    "physics": {
        "enabled": true,
        "forceAtlas2Based": {
            "avoidOverlap": 0,
            "centralGravity": 0.01,
            "damping": 0.4,
            "gravitationalConstant": -50,
            "springConstant": 0.08,
            "springLength": 100
        },
        "solver": "forceAtlas2Based",
        "stabilization": {
            "enabled": true,
            "fit": true,
            "iterations": 1000,
            "onlyDynamicEdges": false,
            "updateInterval": 50
        }
    }
};

                  


                  

                  network = new vis.Network(container, data, options);

                  

                  

                  


                  

                  return network;

              }
              drawGraph();
        </script>
